First, we need to determine how many calories are in a 300g bag of chips. Since each serving contains 250 calories and a 300g bag has 5 servings:

\[
\text{Calories per serving} = 250 \text{ calories}
\]

\[
\text{Calories per serving} \times 5 \text{ servings} = 1250 \text{ calories}
\]

Next, we need to find out how many calories you can consume without exceeding your daily calorie target of 2000 calories. You have already consumed 1800 calories:

\[
2000 \text{ calories} - 1800 \text{ calories} = 200 \text{ calories}
\]

Since the bag of chips contains 250 calories per serving, we need to calculate how many servings you can eat with the remaining calories:

\[
\frac{200 \text{ calories}}{250 \text{ calories per serving}} = 0.8 \text{ servings}
\]

